import React from "react";

const App: React.FC = () => {
  return (
    <div className="grid">
      <h2 className="text-2xl font-bold leading-7 text-gray-900 sm:truncate sm:text-3xl sm:tracking-tight">Welcome to Agnos Health Check</h2>
      <div className="flex justify-center items-center h-screen bg-gray-100">
        <h1 className="text-4xl font-bold">Hello, World!</h1>
      </div>
    </div>
  );
};

export default App;
